window.bookSummaryJSON = "<p>Thea and Julian have made their choice, but can they survive the fallout?</p> <p>Returning to the world of the vampire elite as Solstice falls, they must navigate new dangers, treacherous allies, and morally grey friendships. The past might hold the key to their future, but to find out, Julian must face the monster he was once, and as forgotten magic stirs in Thea's blood, the search for answers leads to devastating consequences.</p> <p>With the future of the magical world hanging in the balance, tensions rising in their family, and war looming on the horizon, will their love triumph, or will they pay the ultimate price?</p> <p>Contains mature themes.</p>"; 
